(770, 72, 'What is the capital of France?', 'subjective', 1, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"The capital of France is Paris. Paris is located in the north-central part of France and is the largest city in the country. It is known for its rich history, culture, and landmarks like the Eiffel Tower and the Louvre Museum.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(771, 72, 'What are the primary colors?', 'subjective', 2, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"The primary colors are red, blue, and yellow. These are colors that cannot be created by mixing other colors together. All other colors can be made by mixing these three primary colors in different combinations.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(772, 72, 'What is 2 + 2?', 'subjective', 3, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"2 + 2 equals 4. This is a basic addition problem where we combine two units with another two units to get a total of four units.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(773, 73, 'What is water made of?', 'subjective', 1, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"Water is made of two hydrogen atoms and one oxygen atom, which is written as H2O. This is a chemical compound where hydrogen and oxygen combine to form water molecules.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(774, 73, 'What planet do we live on?', 'subjective', 2, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"We live on planet Earth. Earth is the third planet from the Sun and is the only known planet that supports life. It has water, atmosphere, and suitable temperature for living organisms.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(775, 73, 'What do plants need to grow?', 'subjective', 3, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"Plants need sunlight, water, air (carbon dioxide), and nutrients from soil to grow. Sunlight provides energy through photosynthesis, water helps transport nutrients, and soil provides essential minerals.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(776, 74, 'Who was the first President of the United States?', 'subjective', 1, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"George Washington was the first President of the United States. He served from 1789 to 1797 and is known as the \\\"Father of His Country\\\" for his leadership during the American Revolutionary War and in establishing the new nation.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(777, 74, 'In which year did World War II end?', 'subjective', 2, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"World War II ended in 1945. The war officially ended on September 2, 1945, when Japan surrendered. This marked the end of one of the deadliest conflicts in human history.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
(778, 74, 'What is the Great Wall of China?', 'subjective', 3, 5, 5, '{\"criteria\":[\"accuracy\",\"completeness\",\"clarity\"],\"model_answer\":\"The Great Wall of China is a series of fortifications built across the northern borders of China. It was constructed over many centuries to protect Chinese states from invasions. It is one of the most famous landmarks in the world and is visible from space.\"}', '2025-12-08 10:43:14', '2025-12-08 10:43:14'),
